import React from "react";

function Cards() {
  return (
    <div>
    <div class="card" style="width: 18rem;">
    <img class="card-img-top" src=".../100px180/?text=Image cap" alt="Card image cap"/>
    <div class="card-body">
    <p class="card-text">Pokemon Card</p>
    </div>
    </div>
    </div>
  );
}

export default Cards;
